import Users from "../models/users.model";

export async function getAll(req, res) {
    try {
        const users = await Users.findAll();
        res.json({ data: users });
    }
    catch (err) {
        res.status(500).json({
            message: 'Users table is empty'
        });
    }
}

export async function getOne(req, res){
    const { id } = req.params;
    const user = await Users.findOne({
        where: { id }
    });
    res.json({
        data: user
    });
}



export async function create(req, res) {
    const { username, password, rol, type } = req.body;
    try {
        let newUser = await Users.create({
            username,
            password,
            rol,
            type
        }, {
            fields: ['username', 'password', 'rol', 'type']
        });
        if (newUser) {
            return res.json({
                message: 'User created',
                data: newUser
            });
        }
    }
    catch (err) {
        console.log(err);
        res.status(500).json({
            message: 'User dont created'
        });
    }
}

export async function deleteUser(req, res){
    const { id } = req.params;
    await Users.destroy({
        where: { id }
    }).then(data => {
        console.log(data);
        res.json({
            message: 'User deleted'
        });
    }).catch(err => {
        console.log(err);
        res.status(500).json({
            message: 'Internal Error'
        });
    });
}

export async function updatedUser(req, res){
    const { id } = req.params;
    const { username, password, rol, type } = req.body; 
    await Users.update({
        username, 
        password, 
        rol, 
        type
    }, {where: { id }}).then(data => {
        if(data == 0){
            res.sendStatus(500);
        }
        else{
            res.json({
                message: 'User was updated'
                
            });
        }

    }).catch(err => {
        console.log(err);
        res.status(500).json({
            message: 'Error while user trying updated'
        });
    });
}

